export default {
  name: "Wrapper",
	data() {
		return {};
	},
	computed: {
		width() {
			switch (this.$vuetify.breakpoint.name) {
				case "xs":
					return "220px";
				case "sm":
					return "400px";
				case "md":
					return "500px";
				case "lg":
					return "600px";
				case "xl":
					return "800px";
			}
		}
	}
};
